form_header.after_load:
//Form.isLoaded = true
try {
setFormElement("total_income", ["paycheck_1", "paycheck_2", "TANF", "SSI", "child_support", "food_stamps", "other_income"].reduce((x, y) => x + (Form.getTestAnswerValue("SH_INCOME", y) ? parseFloat(Form.getTestAnswerValue("SH_INCOME", y)) : 0), 0))
setFormElement("total_housing", ["rent", "electricity", "gas", "water", "maintenance", "rent_insurance"].reduce((x, y) => x + (Form.getTestAnswerValue("SH_Housing", y) ? parseFloat(Form.getTestAnswerValue("SH_Housing", y)) : 0), 0))
setFormElement("total_basic", ["groceries", "rx", "other_basic"].reduce((x, y) => x + (Form.getTestAnswerValue("SH_Basic", y) ? parseFloat(Form.getTestAnswerValue("SH_Basic", y)) : 0), 0))
setFormElement("total_child", ["childcare", "diapers", "formula", "activities"].reduce((x, y) => x + (Form.getTestAnswerValue("SH_Child", y) ? parseFloat(Form.getTestAnswerValue("SH_Child", y)) : 0), 0))
setFormElement("total_transportation", ["bus_taxi", "vehicle_loan", "vehicle_insurance", "vehicle_gas"].reduce((x, y) => x + (Form.getTestAnswerValue("SH_Transportation", y) ? parseFloat(Form.getTestAnswerValue("SH_Transportation", y)) : 0), 0))
setFormElement("total_fixed", ["phone", "cable", "internet", "creditor_1", "creditor_2", "creditor_3", "creditor_4"].reduce((x, y) => x + (Form.getTestAnswerValue("SH_Fixed", y) ? parseFloat(Form.getTestAnswerValue("SH_Fixed", y)) : 0), 0))
setFormElement("total_variable", ["cig_alc", "other_1", "other_2"].reduce((x, y) => x + (Form.getTestAnswerValue("SH_Variable", y) ? parseFloat(Form.getTestAnswerValue("SH_Variable", y)) : 0), 0))
setFormElement("total_spending", ["total_housing", "total_basic", "total_child", "total_transportation", "total_fixed", "total_variable"].reduce((x, y) => x + parseFloat(getFormElement(y)), 0))
var diff = parseFloat(getFormElement("total_income")) - parseFloat(getFormElement("total_spending"))
setFormElement("surplus", diff > 0 ? diff : 0)
setFormElement("shortage", diff < 0 ? diff : 0)
} catch {}
